import styled from "styled-components"

export const ArticlePage = styled.header`
	max-width: 61.25em;
	display: flex;
	flex-direction: column;
	align-items: center;
	justify-content: center;
  width:100%;
`

export const ArticleHeader = styled.h1`

	font-size:46px;
`
